function ListGroup() {
  let items = [
    "An item",
    "A second item",
    "A third item",
    "A fourth item",
    "And a fifth one",
  ];
  const message = items.length === 0 ? <p>No items found</p>: null;
  // items = []; // Uncomment this line to test the empty state
  return (
    //Simple Syntax for Fragment from React
    <>
      <h1>List</h1>
      {message}
      <ul className="list-group">
        {items.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </>
  );
}

export default ListGroup;
